a74 \uc548\ub3fc\"(\uc885\ud569)","\uc791\ubcc4\uc778\uc0ac \ud558\ub294 \ubd81\uce21 \uac00\uc871\ub4e4","'\uae40\uc6a9\ud310 \ubb34\uc8c4' \ud6c4\ud3ed\ud48d\u2026\u91ce, \ud669\uad50\uc548 \ud574\uc784\u00b7\ud2b9\uac80 \uc694\uad6c","\ub3d9\ud574\uc548 \uc774\ud2c0\uc9f8 '\ub208 \ud3ed\ud0c4' \uac15\ub989 40.5\u339d\u2026\ub208 \ud53c\ud574 \uc18d\ucd9c","\uc704\uc131\uc5d0\uc11c \ubcf8 \uc5ec\uc218 \uc6d0\uc720 \uc720\ucd9c \uc0ac\uace0","\uc2e0\ud55c\u00b7\ud604\ub300\u00b7\ud558\ub098SK\uce74\ub4dc \uc804\ud654 \uc601\uc5c5 \uc7ac\uac1c(\uc885\ud569)","\uae30\ub984\uc720\ucd9c \uc5ec\uc218 \ubc14\ub2e4 \uae34\uae09\uc601\ud5a5\uc870\uc0ac \ucc29\uc218","\uc724\uc9c4\uc219 \uc7a5\uad00 \"\ucd5c\ub300 \ud53c\ud574\uc790\ub294 \uc815\uc720\uc0ac\" \ubc1c\uc5b8 \ub17c\ub780","\ud3ed\uc124\uc744 \uc990\uae30\uc790\u2026\uac15\ub989 \ub3c4\uc2ec\uc5d0 \ub300\ud615 \ub208\uc0ac\ub78c","\ube59\uadf8\ub808 \uacf5\uc7a5 \ud3ed\ubc1c\uc0ac\uace0 \uc774\ud2c0\uc9f8 \uc6d0\uc778 \uc870\uc0ac '\ub09c\ud56d'(\uc885\ud569)","\uc704\uc131\uc5d0\uc11c \ubcf8 \uc5ec\uc218 \uc6d0\uc720 \uc720\ucd9c \uc0ac\uace0","\uac15\uc6d0\u00b7\uacbd\ubd81 \ub2f7\uc0c8\uc9f8 '\ub208 \ud3ed\ud0c4'\u2026\ud55c\ubc18\ub3c4 \ub3d9\ucabd '\ub9c8\ube44'(\uc885\ud5692\ubcf4)","\uae08\uc735\uc0ac 13\uacf3 \uc218\ucc9c\uc5b5 \ub300\ucd9c\uc0ac\uae30 \ud53c\ud574, \ub2f9\ud558\uace0\ub3c4 4~5\ub144\uac04 \ubab0\ub77c\u2026 \uae08\uc735\uc2dc\uc2a4\ud15c \u2018\uad6c\uba4d\u2019","\ud544\ub9ac\ud540\uc11c \ud55c\uad6d\uc778 40\uc2dc\uac04 \ud45c\ub958\ud558\ub2e4 \uadf9\uc801 \uad6c\uc870","2\ub144\uc9f8 \ub9de\uc740 '\ub274\ud0c0\uc6b4 \ucd9c\uad6c\uc804\ub7b5' \uc131\uacfc\uc640 \uacfc\uc81c\ub294","\ud0dc\uc548\uc758 \uc870\uc5b8 \"\uc5ec\uc218\uc8fc\ubbfc, \ud53c\ud574 \uc99d\uac70 \ud655\ubcf4 \uc911\uc694\"","\uacbd\uc8fc \ub9c8\uc6b0\ub098\uc624\uc158\ub9ac\uc870\ud2b8 \ubd95\uad34\uc0ac\uace0 \uc65c \uc77c\uc5b4\ub0ac\ub098","\ud3ed\uc124 6\uc77c\uac04 \ub099\uc0c1\u00b7\uace0\ub9bd\u00b7\uad50\ud1b5\uc0ac\uace0 \ubaa8\ub450 119\uba85 \uad6c\uc870","[\ub9ac\uc870\ud2b8 \ubd95\uad34\ucc38\uc0ac]10\uba85 \uc0ac\ub9dd\u00b7103\uba85 \ubd80\uc0c1\u2026\uc2e4\uc885\uc790 \ub354 \uc5c6\uc744 \ub4ef","\uc720\ud734\uc2dc\uc124, \uc0dd\ud65c\ubb38\ud654\uc13c\ud130\ub85c \uc801\uadf9\ud65c\uc6a9\u2026\uc778\ubb38\uc9c4\ud765\ubc95 \ucd94\uc9c4","\uacbd\ucc30, \ubd95\uad34\ucc38\uc0ac \ub9c8\uc6b0\ub098\ub9ac\uc870\ud2b8 \ub4f1 5\uacf3 \uc555\uc218\uc218\uc0c9(\uc885\ud569)","\ub05d\uc5c6\ub294 \uc0bd\uc9c8\uc5d0\ub3c4 \ubb34\ub108\uc9c0\uc9c0 \uc54a\ub294 \u2018\uaca8\uc6b8\uc655\uad6d\u2019","\u6aa2 '\uac04\ucca9\uc0ac\uac74' \uc911\uad6d\uacfc \ud615\uc0ac\uc0ac\ubc95\uacf5\uc870\uc808\ucc28 \ub3cc\uc785","IC\uce69 \uc5c6\ub294 \uce74\ub4dc, 3\uc77c\ubd80\ud130 \ud604\uae08\uc778\ucd9c \ubabb\ud55c\ub2e4","\ud604\uc624\uc11d \"\ubd80\ub3d9\uc0b0 \uc2dc\uc7a5, \uc0c1\ub2f9\ud55c \ud68c\ubcf5 \uc870\uc9d0 \uc788\ub2e4\"(\uc885\ud5692\ubcf4)","11\ub144\ub9cc\uc5d0 \uce74\ub4dc\uc0ac \uc601\uc5c5\uc815\uc9c0\u2026\uc0ac\uc0c1 \ucd5c\uace0 \uc218\uc704\uc758 \uc9d5\uacc4","11\ub144\ub9cc\uc5d0 \uce74\ub4dc\uc0ac \uc601\uc5c5\uc815\uc9c0\u2026\uc0ac\uc0c1 \ucd5c\uace0 \uc218\uc704\uc758 \uc9d5\uacc4","\u7f8e '\uc2a4\ub178\ub9c8\uac9f\ub3c8'\u2026\uc5f0\ubc29\uc815\ubd80 \uc62c\uaca8\uc6b8 3\ubc88\uc9f8 '\uc167\ub2e4\uc6b4'(\uc885\ud569)","\u6aa2, \uc804\uc7ac\uc6a9 \uc9d5\uc5ed 6\ub144\u00b7\uc774\ucc3d\uc11d \uc9d5\uc5ed 5\ub144 \uad6c\ud615(\uc885\ud569)","'\uc815\uc758\u00b7\ud1b5\ud569\u00b7\ud3c9\ud654' \uc548\ucca0\uc218\uc758 \uc0c8 \uc815\uce58, \uc724\uacfd \ub098\uc654\uc9c0\ub9cc\u2026","\uc720\uc0b0\uc18c \uc6b4\ub3d9\ud558\ub294 \ud55c\uad6d\uc778 \uc810\ucc28 \uac10\uc18c\u202610\uba85\uc911 3\uba85\ubfd0","\uc774\uc0b0\uac00\uc871 \uc0c1\ubd09,  \ub0a8\ubd81\uad00\uacc4 '\ud6c8\ud48d'\uc73c\ub85c \uc774\uc5b4\uc9c0\ub098","\uac15\uae30\ud6c8 \"\uc7ac\ud310\ubd80\uac00 \uc720\uac10 \ud45c\uc2dc\ud558\uc9c0 \uc54a\uc740 \uac83\uc774 \uc720\uac10\uc774\ub2e4\"","\uac80\ucc30, '\uc99d\uac70\uc704\uc870 \uc0ac\uac74' \uad6d\uc815\uc6d0 \ud68c\uc2e0\uc790\ub8cc \ud655\uc778\uc791\uc5c5 \ucc29\uc218(\uc885\ud569)","\ud669\uad50\uc548 \ud574\uc784\uc548 \ubcf8\ud68c\uc758 \ubcf4\uace0\u2026\uc815 \ucd1d\ub9ac \"\ucc45\uc784 \ub17c\ud560 \ub2e8\uacc4 \uc544\ub0d0\"(\uc885\ud569)","\uc804\ub0a8 \uc601\uad11 \ud55c\ube5b\uc6d0\uc804 2\ud638\uae30 \uac00\ub3d9 \uc911\ub2e8(\uc885\ud5692\ubcf4)","\ub9ac\uc870\ud2b8 \ubd95\uad34 \uc218\uc0ac\ubc1c\ud45c\u2026\ud480\ub9ac\uc9c0 \uc54a\uc740 3\ub300 \ubbf8\uc2a4\ud130\ub9ac","\uc124\ub0a0 \uadfc\ubb34\ub3c4 \uc11c\ub7ec\uc6b4\ub370\u2026\uc218\ub2f9\ub3c4 \ubabb \ubc1b\uc740 \ub2f9\uc2e0","\u5317, \u5357\uc5d0 \ud55c\ubbf8\uad70\uc0ac\ud6c8\ub828 \uc911\uc9c0 \ucd09\uad6c\u2026\"\ud569\uc758\uc774\ud589 \uc7ac\uace0\"(2\ubcf4)","2\ucc28 \uc774\uc0b0\uac00\uc871 \uc0c1\ubd09\ub2e8, \uc624\ud6c4 3\uc2dc7\ubd84 \uccab \ub2e8\uccb4\uc0c1\ubd09 \uc2dc\uc791(\uc18d\ubcf4)","\u5317  \uae40\uc815\uc6b1\uc528 \uc11d\ubc29\u00b7\uc1a1\ud658 \uc694\uad6c \uc6b0\ub9ac\uc815\ubd80 \ud1b5\uc9c0\ubb38 \uc218\ub839 \uac70\ubd80","\ub3c4\ub110\ub4dc \uadf8\ub808\uadf8 \uc804 \uc8fc\ud55c \ubbf8\uad6d\ub300\uc0ac \ud3c9\uc591 \ubc29\ubb38(\uc885\ud5692\ubcf4)","\uc124 \uc5f0\ud734 \uae30\ub984 \uc720\ucd9c\u00b7\uc5f4\ucc28 \ud0c8\uc120 \ub4f1 `\uc2dc\ub04c'","[\uc774\uc288&amp;\ub274\uc2a4] \ud3ed\uc124\uc5d0 \uc9c0\uc5ed\uacbd\uc81c \uba48\ucdb0\u2026\uc7ac\ub09c \uc120\uc81c \ub300\uc751 \ud544\uc694","\uadc0\ub9c9\uc740 \uc77c\ubcf8, \uacc4\uc18d \ub3c4\ubc1c\u2026\ud55c\uc77c\uad00\uacc4 \ucd9c\uad6c \ubabb\ucc3e\uc544","\u65e5\uc815\ubd80 \"'\u8ecd\uc704\uc548\ubd80 \uac15\uc81c\ub3d9\uc6d0 \uc778\uc815' \uace0\ub178\ub2f4\ud654 \uac80\uc99d\"(\uc885\ud569)","[\ucee4\ubc84\uc2a4\ud1a0\ub9ac-\uc11c\uc6b8\uc740 \u2018\ud638\ud154 \uacf5\ud654\uad6d\u2019] \uc11c\uc6b8, \ud638\ud154 \uc9c0\ub3c4\ub97c \uc0c8\ub85c \uadf8\ub9ac\ub2e4","\uacbd\ucc30 \"\uccb4\uc721\uad00 \ubcf4\uc870\uae30\ub465 \ubaa8\ub450 \ubcfc\ud2b8 2\uac1c\ubfd0\"(\uc885\ud5692\ubcf4)","'\uad6d\uc815\uc6d0 \uc218\uc0ac \uc740\ud3d0 \uc758\ud639' \uae40\uc6a9\ud310 \ubb34\uc8c4 \uc120\uace0 \uc774\uc720\ub294","\ud1b5\ud569\uc9c4\ubcf4\ub2f9 \uc815\ub2f9\ud574\uc0b0 \uc2ec\ud310 2\ucc28 \ubcc0\ub860","\"\uc815\ub2f9\ud574\uc0b0\uc740 \uc608\ubc29 \uc870\uce58\" vs \"\uad6c\uccb4\uc801 \uc704\ud5d8 \uac80\ud1a0\ud574\uc57c\"","[\uc774\uc11d\uae30 \uc9d5\uc5ed 12\ub144 \uc120\uace0] \u201cRO \uc2e4\uccb4 \uc788\ub2e4\u201d \ud310\uacb0\u2026\uc218\uc138 \ubab0\ub9b0 \ud1b5\ud569\uc9c4\ubcf4\ub2f9","\"\uc9c0\ucf1c\uc8fc\uc9c0 \ubabb\ud574 \ubbf8\uc548\ud574\" \ubd80\uc0b0\uc678\ub300 \ud569\ub3d9\uc601\uacb0\uc2dd(\uc885\ud569)","[\ub180\uc774\uac00 \ubc25\uc774\ub2e4]\uc544\uc774\ub4e4, \uc5b4\ub9b4 \uc801 \ubd80\ubaa8\uc758 20~30%\ubc16\uc5d0 \ubabb \ub180\uc544\u2026 \ub178\ub294 \ubc95\ub3c4 \ub2ec\ub77c","\uc2e0\uc785\uc0dd\ud658\uc601\ud68c \ubd80\uc2e4\u00b7\uc878\uc18d \ucd94\uc9c4\u2026\ud559\uad50 \uc218\uc218\ubc29\uad00","\"\uc544\ud30c\ub3c4 \ub9cc\ub098\uc57c\uc9c0\"\u2026\u5357\uc774\uc0b0\uac00\uc871 82\uba85 \uae08\uac15\uc0b0\uc73c\ub85c \ucd9c\ubc1c(\uc885\ud569)","\ubbf8\uc138\uba3c\uc9c0\ub294 \uba40\uace0, \uc624\uc5fc\ub41c \uc2e4\ub0b4\uacf5\uae30\ub294 \uac00\uae5d\ub2e4","\ud3ec\uadfc\ud55c \uc5f0\ud734 \uc14b\uc9f8 \ub0a0\u2026\uc804\uad6d \ud750\ub9ac\uace0 \uacf3\uacf3 \ube44","\uce5c\uad6c\ub85c\uc11c \uc6b0\ub9ac\uc758 \uc2a4\ubb34 \uc0b4\uc744 \ucd95\ud558\ud574\uc8fc\uc138\uc694","\ub3c4\uc120\uc0ac \uba74\ud5c8 5\ub144\ub9c8\ub2e4 \uac31\uc2e0\u2026\uaddc\uc815 \uc704\ubc18\uc2dc \uba74\ud5c8 \uac15\ub4f1","\u7f8e\ubc84\uc9c0\ub2c8\uc544 '\ub3d9\ud574\ubcd1\uae30\u6cd5' \ud558\uc6d0 \uc0c1\uc784\uc704 \uad00\ubb38\ub3c4 \ud1b5\uacfc(\uc885\ud569)","[\ub2e8\ub3c5] \ubbfc\ub9dd\ud55c \uc218\ud559\uac15\uad6d\u2026 \uace0\uad50 \uc808\ubc18 \u2018\ub099\uc81c\uc810\u2019","&lt;\u9751 \ub300\ubcc0\uc778 \uacf5\ubc31\ud574\uc18c\u2026'\ubd88\ud1b5\ub17c\ub780'\uc18d \uc5ed\ud560 \uc8fc\ubaa9&gt;(\uc885\ud569)","\uae08\uc735\ub2f9\uad6d, \ud604\uc7ac\ud604 \ud68c\uc7a5 \uc8fc\uac00\uc870\uc791 \ud610\uc758 \ud3ec\ucc29","\ud544\ub9ac\ud540, FA-50 \ub300\uae08\uc9c0\uae09\uc548 \ucd5c\uc885 \uc2b9\uc778\u2026\"\uace7 \ud0c0\uacb0\"(\uc885\ud569)","\ub0a8\ubd81 \uace0\uc704\uae09 \uc811\ucd09 \uc885\ub8cc\u2026\uacb0\uacfc \uace7 \ubc1c\ud45c(\uc885\ud569)","\ud604\uc624\uc11d, \uc610\ub7f0 \uc758\uc7a5\uc5d0 \uc9c8\uc11c\uc815\uc5f0\ud55c \ud14c\uc774\ud37c\ub9c1 \ub2f9\ubd80","\u65e5\uc815\ubd80 \"'\u8ecd\uc704\uc548\ubd80 \uac15\uc81c\ub3d9\uc6d0 \uc778\uc815' \uace0\ub178\ub2f4\ud654 \uac80\uc99d\"(\uc885\ud569)","\u2018\ub178\uc608 \ub178\ub3d9\u2019 \ud64d\ubb38\uc885\uc758 \uc544\ud504\ub9ac\uce74\ubc15\ubb3c\uad00 \ucc3e\uc544\uac00\ubcf4\ub2c8\u2026","\uce74\ub4dc\uc815\ubcf4\uc720\ucd9c \uad6d\uc815\uc870\uc0ac\u2026\uc815\uc2e0\uc801 \ubcf4\uc0c1 \ub193\uace0 '\uc124\uc655\uc124\ub798'","\u8207 \uc804\ub2f9\ub300\ud68c 7\uc6d4 14\uc77c \ud655\uc815\u2026\ubb38\ub300\uc131 \ubcf5\ub2f9 \uc0ac\uc2e4\uc0c1 \uc2b9\uc778 (\uc0c1\ubcf4)","\uad6d\ubbfc\u00b7\ub86f\ub370\u00b7\ub18d\ud611\uce74\ub4dc 17\uc77c\ubd80\ud130 3\uac1c\uc6d4 \uc601\uc5c5\uc815\uc9c0(\uc885\ud5692\ubcf4)","\uc815\ubcf4\uc720\ucd9c \uce74\ub4dc\u793e 5\uc6d4 16\uc77c\uae4c\uc9c0 \uc601\uc5c5\uc815\uc9c0","\ubc95\uc6d0 \u201c\ub0a8\ud3b8 \ub3d9\uc758 \uc5c6\uc774 \ube4c\ub9b0 \uc790\ub140 \ud559\ube44\u2026 \ub0a8\ud3b8 \ubd84\ud560\uc758\ubb34 \uc5c6\ub2e4\u201d","\u5317 \ud55c\ubbf8\uad70\uc0ac\ud6c8\ub828 \uc77c\uc815 \ubc1c\ud45c \uccab\ub0a0 \uc77c\ub2e8 '\uce68\ubb35'","'\ub0b4\ub780\uc74c\ubaa8 \uc7ac\ud310' \uc120\uace0\ub9cc \ub0a8\uc544\u2026\ud310\uacb0 \uc608\uc0c1 \uc7c1\uc810\uc740","\uac80\ucc30, '\uc99d\uac70\uc704\uc870 \uc0ac\uac74' \uad6d\uc815\uc6d0 \ud68c\uc2e0\uc790\ub8cc \ud655\uc778\uc791\uc5c5 \ucc29\uc218(\uc885\ud569)","'\uad6d\uc815\uc6d0 \uc218\uc0ac \uc740\ud3d0 \uc758\ud639' \uae40\uc6a9\ud310 \ubb34\uc8c4 \uc120\uace
